BEGIN TRANSACTION;
CREATE TABLE "outros_servico1" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "funcionario2_id" integer NOT NULL REFERENCES "outros_funcionario" ("id"), "servico2_id" integer NOT NULL REFERENCES "outros_servico" ("id"));
CREATE TABLE "outros_servico" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nome" varchar(200) NOT NULL, "preco" decimal NOT NULL, "obs" varchar(200) NULL);
CREATE TABLE "outros_produto" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nome" varchar(200) NOT NULL, "preco" decimal NOT NULL, "obs" varchar(200) NULL, "tipo" varchar(200) NULL);
CREATE TABLE "outros_item" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "qnt" integer NOT NULL, "obs" varchar(200) NULL, "produto1_id" integer NOT NULL REFERENCES "outros_produto" ("id"), "total" decimal NOT NULL);
CREATE TABLE "outros_funcionario" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nome" varchar(200) NOT NULL, "telefone" varchar(15) NOT NULL, "func" varchar(1) NOT NULL, "telefone1" varchar(15) NULL);
CREATE TABLE "outros_comanda_produtos" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "comanda_id" integer NOT NULL REFERENCES "outros_comanda" ("id"), "item_id" integer NOT NULL REFERENCES "outros_item" ("id"));
CREATE TABLE "outros_comanda_corte_servicos" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "comanda_corte_id" integer NOT NULL REFERENCES "outros_comanda_corte" ("id"), "servico1_id" integer NOT NULL REFERENCES "outros_servico1" ("id"));
CREATE TABLE "outros_comanda_corte" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "total" decimal NOT NULL, "data" datetime NOT NULL);
CREATE TABLE "outros_comanda" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "total" decimal NOT NULL, "num" integer NOT NULL, "estado" varchar(1) NOT NULL, "data" datetime NOT NULL);
CREATE TABLE "home_servico" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nome" varchar(200) NOT NULL, "preco" decimal NOT NULL);
CREATE TABLE "home_produto" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nome" varchar(200) NOT NULL, "preco" decimal NOT NULL);
CREATE TABLE "home_item" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "qnt" integer NOT NULL, "obs" varchar(200) NULL, "produto1_id" integer NOT NULL REFERENCES "home_produto" ("id"));
CREATE TABLE "home_comanda_servicos" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "comanda_id" integer NOT NULL REFERENCES "home_comanda" ("id"), "servico_id" integer NOT NULL REFERENCES "home_servico" ("id"));
CREATE TABLE "home_comanda_produtos" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "comanda_id" integer NOT NULL REFERENCES "home_comanda" ("id"), "item_id" integer NOT NULL REFERENCES "home_item" ("id"));
CREATE TABLE "home_comanda" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "total" decimal NOT NULL, "data" datetime NOT NULL);
CREATE TABLE "django_site" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "domain" varchar(100) NOT NULL, "name" varchar(50) NOT NULL);
CREATE TABLE "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL, "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id"), "user_id" integer NOT NULL REFERENCES "auth_user" ("id"), "action_time" datetime NOT NULL);
CREATE TABLE "cliente_cliente" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "nome" varchar(200) NOT NULL, "telefone1" varchar(20) NOT NULL, "telefone2" varchar(20) NULL);
CREATE TABLE "caixa_caixa" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "tipo" varchar(1) NOT NULL, "data" datetime NOT NULL, "desc" varchar(100) NOT NULL, "total" decimal NOT NULL);
CREATE TABLE "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id"), "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id"), UNIQUE ("user_id", "permission_id"));
CREATE TABLE "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id"), "group_id" integer NOT NULL REFERENCES "auth_group" ("id"), UNIQUE ("user_id", "group_id"));
CREATE TABLE "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "first_name" varchar(30) NOT NULL, "last_name" varchar(30) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "username" varchar(150) NOT NULL UNIQUE);
CREATE TABLE "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id"), "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id"), "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id"), UNIQUE ("group_id", "permission_id"));
CREATE TABLE "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(80) NOT NULL UNIQUE);
CREATE TABLE "agenda_agenda" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "confirmado" varchar(1) NOT NULL, "cliente1_id" integer NOT NULL REFERENCES "cliente_cliente" ("id"), "func1_id" integer NOT NULL REFERENCES "outros_funcionario" ("id"), "servico1_id" integer NOT NULL REFERENCES "outros_servico" ("id"), "data" datetime NOT NULL);
